import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { CssBaseline, Container, Grid, Paper, Typography, AppBar, Toolbar, IconButton, Avatar, List, ListItem, ListItemIcon, ListItemText, Divider } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon, Search as SearchIcon, Notifications as NotificationsIcon, ExitToApp as ExitToAppIcon, Home as HomeIcon, Settings as SettingsIcon, TrendingUp as TrendingUpIcon, ShoppingCart as ShoppingCartIcon } from '@mui/icons-material';
import Overview from './Overview';
import Products from './Products';
import Settings from './Settings';
import UserDashboard from './UserDashboard';
import LandingPage from './LandingPage';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/overview" element={<Overview />} />
          <Route path="/products" element={<Products />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/user-dashboard" element={<UserDashboard />} />
        </Routes>
      </Router>
    </ThemeProvider>
  );
}

export default App;
